(14, 'viagem', '2015-05-20 08:00:39', '2015-05-20 10:00:39', 'Equitron', 'Em 1984 nascia a EQUITRON Automação Eletrônico Mecânica Ltda, empresa fundada a partir da iniciativa de um mestre em engenharia elétrônica formado pela EESC/USP. A proposta inicial foi desenvolver e produzir servo-motores e seus acionamentos eletrônicos, até então importados. Porém com as novas oportunidades e expectativas do mercado, aliadas ao entusiasmo por novos desafios, a EQUITRON passou, em 1992, a desenvolver também aplicações para mecanismos servo-acionados, tornando-se com o tempo, uma empresa especializada em soluções para automação de processos de manufatura.\n \n\nCom experiência de 30 anos, a EQUITRON destaca-se como criadora de soluções, produzindo linhas de montagens, células robotizadas, e equipamentos especiais para soldagem e testes não destrutivos.\n\nInstalada na cidade de São Carlos, centro geográfico do estado de São Paulo, conta com uma área de 6.000 metros quadrados e um corpo de 70 colaboradores. Com soluções inovadoras e criativas tem firmado sua participação num mercado altamente qualificado, trilhando sua própria história de sucesso.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"A EQUITRON destaca-se como criadora de solu\\u00e7\\u00f5es, produzindo linhas de montagens, c\\u00e9lulas robotizadas, e equipamentos especiais para soldagem e testes n\\u00e3o destrutivos. Local: S\\u00e3o Carlos\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/equitron.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Cal\\u00e7a comprida e sapato fechado!\"}}', 11, ''),
(15, 'minicurso', '2015-05-21 08:00:36', '2015-05-21 18:00:36', 'Microcontroladores', 'O minicurso tem o objetivo de apresentar os microcontroladores e de ensinar aos participantes como fazer uso dos mesmos.\nUm microcontrolador é um computador-num-chip, contendo um processador, memória e periféricos de entrada/saída. É um microprocessador que pode ser programado para funções específicas, em contraste com outros microprocessadores de propósito geral.', '{\"location\":\"Sala Lei Menor\",\"desc\":\"Aprenda a usar um microcontrolador, que \\u00e9 um computador-num-chip, contendo um processador, mem\\u00f3ria e perif\\u00e9ricos de entrada\\/sa\\u00edda\",\"palestrantes\":\"Prof. Dr. Marcelo Vieira\",\"pic\":\"\\/images\\/icons\\/pic.png\",\"vagas\":\"24\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(16, 'viagem', '2015-05-20 08:00:09', '2015-05-20 12:00:40', 'Andritz', 'Em 2008 foi formada a ANDRITZ HYDRO Inepar do Brasil S / A (AHI) a partir da da aquisição, pela Andritz das ações da GE Brasil, na Joint venture GE Hidro Inepar do Brasil S / A. A AHI apresenta referência mundial em geração de energia e possui parque industrial localizado na cidade de Araraquara, São Paulo. Este parque industrial é um dos mais modernos, amplo e equipado da América Latina e uma das maiores fábricas do mundo de geradores, turbinas hidráulicas, equipamentos hidromecânicos e demais equipamentos associados.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"Este parque industrial \\u00e9 um dos mais modernos, amplo e equipado da Am\\u00e9rica Latina e uma das maiores f\\u00e1bricas do mundo de geradores, turbinas hidr\\u00e1ulicas, equipamentos hidromec\\u00e2nicos e demais equipamentos associados.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/andritz.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(17, 'viagem', '2015-05-20 08:00:39', '2015-04-24 18:00:39', 'LIT - INPE', 'O Laboratório de Integração e Testes (LIT), inaugurado em 02 de dezembro de 1987, tem como missão:\n-Contribuir para a progressiva autonomia do País em áreas estratégicas.\n-Prover suporte técnico para os esforços do setor produtivo nacional em desenvolver sua competitividade no mercado internacional.\n-Criar o ambiente necessário para a promoção de programas espaciais nacionais e em cooperação com outros países, provendo serviços de alta qualidade, baixo custo e nos prazos corretos.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"O LIT \\u00e9 um dos laborat\\u00f3rios do Instituto Nacional de Pesquisas Espaciais (INPE) em S\\u00e3o Jos\\u00e9 dos Campos.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/inpe.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Levar dinheiro para almo\\u00e7o!\"}}', 11, ''),
(19, 'minicurso', '2015-05-20 14:00:42', '2015-05-20 18:00:42', 'Canvas', 'A Oficina Canvas visa apresentar e exercitar a construção de modelos de negócio inovadores, com a aplicação da metodologia presente no livro Business Model Generation, de Alexander Osterwalder.', '{\"location\":\"Mecatr\\u00f4nica 01\",\"desc\":\"A Oficina Canvas visa apresentar e exercitar a constru\\u00e7\\u00e3o de modelos de neg\\u00f3cio inovadores, com a aplica\\u00e7\\u00e3o da metodologia presente no livro Business Model Generation, de Alexander Osterwalder.\",\"palestrantes\":\"M\\u00e1rio S\\u00e9rgio da Costa\",\"pic\":\"\\/images\\/icons\\/canvas.png\",\"vagas\":\"20\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(20, 'minicurso', '2015-05-21 08:00:42', '2015-05-21 18:00:42', 'Adams', 'ADAMS é o software de &amp;amp;quot;dinâmica de vários corpos&amp;amp;quot; mais usado mundialmente,  e ajuda o engenheiro a estudar como o movimento, carregamentos e forças são distribuídos através de um sistema mecânico.\nO objetivo deste minicurso e apresentar os básicos da ferramenta aos participantes, mostrando como utiliza-la e também sua importância na engenharia moderna.', '{\"location\":\"Biblioteca\",\"desc\":\"Minicurso de ADAMS, o software de din\\u00e2mica de v\\u00e1rios corpos\",\"palestrantes\":\"Thiago Sampaio da Costa\",\"pic\":\"\\/images\\/icons\\/adams.png\",\"vagas\":\"12\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(21, 'minicurso', '2015-05-21 08:00:16', '2015-05-21 16:00:16', 'Excel', 'O EXCEL é uma ferramenta computacional com diversas aplicações, desde a criação de simples tabelas, até a geração de analises em massa. O domínio desse programa é capaz de facilitar diversos problemas na vida profissional e acadêmica de várias pessoas.', '{\"location\":\"STI 2\",\"desc\":\"Aprenda os b\\u00e1sicos da utiliza\\u00e7\\u00e3o do EXCEL\",\"palestrantes\":\"Igor Castro\",\"pic\":\"\\/images\\/icons\\/excel.jpeg\",\"vagas\":\"20\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(22, 'minicurso', '2015-05-21 08:00:36', '2015-05-21 12:00:36', 'Kinect', 'O minicurso de Kinect tem como objetivo conhecer as ferramentas necessárias para a manipulação de imagens e dados 3D reais do Kinect, assim será possível entender como é dado sua aplicação em projetos robóticos que demanda o conhecimento do espaço externo onde o projeto robótico seja inserido. Ministrado pelo Prof. Dr. Fernando Osório, que tem como linha de pesquisa sistemas embarcados evolutivos e robóticos.', '{\"location\":\"STI 3\",\"desc\":\"Conhe\\u00e7a ferramentas para manipula\\u00e7\\u00f5es de imagens e dados 3D reais do Kinect. Veja tamb\\u00e9m poss\\u00edveis aplica\\u00e7\\u00f5es em projetos rob\\u00f3ticos\",\"palestrantes\":\"Fernando Santos Os\\u00f3rio\",\"pic\":\"\\/images\\/icons\\/kinect.png\",\"vagas\":\"30\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(23, 'minicurso', '2015-05-21 08:00:00', '2015-05-21 16:00:00', 'Eagle', 'O CadSoft EAGLE é um dos principais programas de desenvolvimento de circuitos eletrônicos, sendo amplamente utilizado devido ao seu baixo custo e grande facilidade de uso. O mini-curso cobre diversos aspectos da utilização do programa e dos conceitos de desenvolvimento de circuitos impressos. Dentre os tópicos abordados estão princípios de Electronic Design Automation (EDA), criação de bibliotecas, definição de esquemáticos e implementação de layouts no ambiente EAGLE. Também serão apresentadas as ferramentas de roteamento e exportação para padrões industriais de fabricação de circuito impresso.', '{\"location\":\"STI 1\",\"desc\":\"O CadSoft EAGLE \\u00e9 um dos principais programas de desenvolvimento de circuitos eletr\\u00f4nicos. O mini-curso cobre diversos aspectos da utiliza\\u00e7\\u00e3o do programa e dos conceitos de desenvolvimento de circuitos impressos. \",\"palestrantes\":\"Rafael Guedes Lang\",\"pic\":\"\\/images\\/icons\\/eagle.png\",\"vagas\":\"25\",\"m\":{\"ch\":\"8 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(24, 'viagem', '2015-05-20 14:00:33', '2015-05-20 18:00:44', 'Xmobots', 'A XMobots é uma empresa brasileira especializada no desenvolvimento, fabricação, treinamento, manutenção e operação de sistemas não tripulados, incluindo UAVs (também conhecidos no Brasil como VANTs - Veículos Aéreos Não Tripulados), AUVs, ROVs, USVs, UGVs e Estações de Controle Terrestre. A origem de seu nome veio da união do prefixo &amp;amp;amp;amp;amp;#039;X&amp;amp;amp;amp;amp;#039;, referindo-se aos meios onde os veículos da empresa são capazes de operar, ou seja, ar, terra ou água, com o termo Mobots, procedente da contração das palavras do inglês &amp;amp;amp;amp;amp;#039;mobile robots&amp;amp;amp;amp;amp;#039; (robôs móveis).', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"Visita a XMobots, especializada no desenvolvimento e fabrica\\u00e7\\u00e3o de VANTs.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/xmo.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(25, 'minicurso', '2015-05-21 09:00:15', '2015-05-21 17:00:15', 'KUKA', 'O participante conhecerá através deste minicurso as atitudes de segurança necessárias para manipulação do robô, além da programação básica do mesmo: programação &amp;amp;amp;amp;quot;ponto-a-ponto&amp;amp;amp;amp;quot;. O próprio participante poderá interagir com o manipulador e fundamentar seus conhecimentos, conhecendo assim a potencial dos robôs manipuladores. Uma breve fundamentação teórica sobre manipuladores será realizada no início e será apresentado também, ao final, noções sobre controle de força.', '{\"location\":\"Sala do Kuka, 2o Andar do Pr\\u00e9dio da Mecatr\\u00f4nica\",\"desc\":\"O participante conhecer\\u00e1 atrav\\u00e9s deste minicurso as atitudes de seguran\\u00e7a necess\\u00e1rias para manipula\\u00e7\\u00e3o do rob\\u00f4, al\\u00e9m da programa\\u00e7\\u00e3o b\\u00e1sica do mesmo. O pr\\u00f3prio participante poder\\u00e1 interagir com o manipulador e fundamentar seus conhecimentos\",\"palestrantes\":\"Gustavo Jos\\u00e9 Giardini Lahr\",\"pic\":\"\\/images\\/icons\\/kuka.png\",\"vagas\":\"10\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(26, 'minicurso', '2015-05-21 08:00:03', '2015-05-21 18:00:03', 'Unity', 'Desenvolva o jogo dos seus sonhos com o Unity! Este minicurso dará uma breve introdução a uma das ferramentas mais populares para o desenvolvimento de jogos atualmente, explicando um pouco sobre os passos necessários para a criação de um game, desde sua concepção até sua publicação.', '{\"location\":\"Sala de Computadores da Mecatr\\u00f4nica\",\"desc\":\" Este minicurso dar\\u00e1 uma breve introdu\\u00e7\\u00e3o a uma das ferramentas mais populares para o desenvolvimento de jogos atualmente, explicando um pouco sobre os passos necess\\u00e1rios para a cria\\u00e7\\u00e3o de um game\",\"palestrantes\":\"Kleber de Oliveira Andrade\",\"pic\":\"\\/images\\/icons\\/unity.png\",\"vagas\":\"30\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(27, 'viagem', '2015-05-20 08:00:30', '2015-05-20 18:00:41', 'AFA', 'Academia da Força Aérea (AFA) é um estabelecimento de ensino em nível superior da Força Aérea Brasileira, na cidade de Pirassununga, Estado de São Paulo e reconhecido pelo Ministério da Educação. Integra o sistema de formação e aperfeiçoamento de pessoal do Comando da Aeronáutica e está subordinada ao Departamento de Ensino da Força Aérea Brasileira (FAB). Tem o objetivo de formar oficiais da ativa para os quadros de aviadores, intendentes e de infantaria da FAB.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"Visita a Academia da For\\u00e7a A\\u00e9rea\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/afa.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(28, 'viagem', '2015-05-20 08:00:59', '2015-05-20 12:00:09', 'TAM', 'A TAM MRO, unidade de negócio voltada às atividades de manutenção, reparo e revisão de aeronaves e componentes aeronáuticos, está comprometida com a segurança do trabalho, saúde, proteção ao meio ambiente, qualificação e valorização de seus profissionais.\nA Liderança da TAM MRO e seus profissionais, próprios e subcontratados, estão comprometidos e são incentivados a:\n• Atender às necessidades e expectativas de nossos clientes;\n• Atuar com ética e de acordo com as leis, normas, regulamentos internos e externos e outros requisitos aplicáveis às operações e aos aspectos ambientais;\n• Utilizar, de forma sustentável, eficiente e com segurança, as tecnologias e boas-práticas aplicadas nas operações, ampliando o nosso compromisso de sermos uma empresa responsável com o meio ambiente, com a vida e a segurança de todas as partes afetadas pelas nossas operações;\n• Assegurar a melhoria contínua dos nossos processos, treinamento e ações educacionais de modo a reforçar a prevenção da poluição com enfoque principal no gerenciamento de resíduos, efluentes líquidos e recursos naturais e a prevenção de acidentes do trabalho em nossas operações;\n• Assegurar que todos os acidentes e incidentes ambientais e do trabalho serão relatados e investigados;\nTodos os profissionais devem ter uma atitude facilitadora para com as partes interessadas quanto à divulgação das questões de saúde, segurança do trabalho e meio ambiente, atuando de forma preventiva, gerenciando os riscos e reduzindo ou eliminando as causas e os impactos dos desvios, e exercendo uma liderança responsável.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"Visita a TAM MRO, onde s\\u00e3o realizados reparos e consertos de aeronaves, junto ao Museu da Avia\\u00e7\\u00e3o da TAM\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/tam.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(29, 'palestra', '2015-05-18 10:45:59', '2015-05-18 12:00:59', 'Uma Aplicação de Agrupamento de Dados', 'Nesta palestra será abordada a técnica K-Médias para agrupamento de dados, a qual será utilizada para criar um codec para áudio. Espera-se, assim, reduzir a quantidade de informação contida em streams de áudio e aumentar o potencial de compactação desses sinais.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Prof. Dr. Rodrigo Fernandes de Mello\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
