(33, 'palestra', '2015-05-22 10:45:44', '2015-05-22 12:00:44', '10 Lições que você só aprende empreendendo', 'Nesse talk, Henrique conta um pouco sobre a sua história e a do pagar.me, frisando em cada momento da conversa uma lição aprendida com aquela parte da história.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"Nesse talk, Henrique conta um pouco sobre a sua hist\\u00f3ria e a do pagar.me, frisando em cada momento da conversa uma li\\u00e7\\u00e3o aprendida com aquela parte da hist\\u00f3ria.\",\"palestrantes\":\"Henrique Dubugras\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
