(93, 'viagem', '2017-05-24 06:30:09', '2017-04-26 13:00:42', 'Hyundai', 'A instalação é responsável pela montagem da linha HB20, totalmente desenvolvida e destinada aos consumidores brasileiros, produzindo cerca de 150 mil carros por ano. Essa empresa desenvolve atividades de estamparia, carroceria, pintura e montagem final dos veículos.', '{\"location\":\"Piracicaba\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"N\\u00e3o \\u00e9 poss\\u00edvel entrar vestindo saia, bermuda, camiseta de time, regata e cal\\u00e7ado aberto (sand\\u00e1lias, tamanco, chinelo) ou de salto (qualquer tamanho). N\\u00e3o \\u00e9 permitido tirar fotografias nas depend\\u00eancias da f\\u00e1brica (\\u00e1rea interna e externa).\"}}', 13, ''),
(94, 'viagem', '2017-05-24 07:00:41', '2017-05-24 13:30:06', 'Tigre', 'Visita à planta responsável pela produção de rotomoldagem, tubos e conexões. É a maior planta fabril de transformação de PVC do mundo, além de corresponder a 14% da arrecadação de impostos do município.', '{\"location\":\"Rio Claro\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"39\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(95, 'viagem', '2017-05-24 11:20:00', '2017-05-24 16:30:18', 'Ambev', 'Visita técnica a planta da Cervejaria Colorado em Ribeirão preto. Os participantes terão a oportunidade de entender o processo produtivo da cerveja além dos seus detalhamentos e ambientações necessárias para a produção em massa de uma cerveja artesanal.', '{\"location\":\"Ribeir\\u00e3o Preto \",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"N\\u00e3o \\u00e9 poss\\u00edvel entrar vestindo saia, bermuda, camiseta de time, regata e cal\\u00e7ado aberto (sand\\u00e1lias, tamanco, chinelo) ou de salto (qualquer tamanho). N\\u00e3o \\u00e9 permitido tirar fotografias nas depend\\u00eancias da f\\u00e1brica (\\u00e1rea interna e externa).\"}}', 13, ''),
(96, 'viagem', '2017-05-24 07:30:40', '2017-05-24 20:00:48', 'Embraer', 'Visita técnica à planta da Embraer, terceira maior empresa de aviação do mundo. Serão expostos aos visitantes linhas de montagens de variados modelos de aviões executivos e comerciais, além de um panorama da trajetoria de sucesso da empresa e informações sobre procedimentos de manufatura e projeto das aeronaves', '{\"location\":\"S\\u00e3o Jos\\u00e9 dos Campos\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"25\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"N\\u00e3o \\u00e9 permitida:\\n\\n\\u2022 A entrada de visitantes trajando bermudas, mini saias, sand\\u00e1lias ou chinelos;\\n\\u2022 A entrada de menores de 18 anos;\\n\\u2022 O uso de filmadoras, m\\u00e1quinas fotogr\\u00e1ficas, gravadores, notebooks, pen drives, cds ou qualquer outro equipamento que possa captar som, imagens ou informa\\u00e7\\u00f5es sobre a empresa.\\n\\u2022 Fumar dentro das nossas instala\\u00e7\\u00f5es.\\n\\u2022 A entrada de visitantes sem autoriza\\u00e7\\u00e3o pr\\u00e9via. \\n\\n\\n\\nTodos os participantes devem se guiar pelas seguintes normas de seguran\\u00e7a exigidas pela Embraer. \\n\\nCada participante ser\\u00e1 respons\\u00e1vel pelo pagamento do seu almo\\u00e7o.\"}}', 13, ''),
(97, 'viagem', '2017-05-24 07:30:41', '2017-05-24 19:00:49', 'INPE', 'Visita técnica ao Instituto Nacional de Pesquisas Espaciais em São José dos Camos, interior de São Paulo. Nestas instalações de alta tecnologia, satélites e dispositivos de monitoramento do território brasileiro são projetados, desenvolvidos e testados. Além disso, a área conta com uma população científica alta empenhada na pesquisa de novas tecnologias aeroespaciais. A visita técnica conta com um tour pelas instalações e áreas de testes do Instituto além de uma palestra sobre o funcionamento e a rotina do lugar.', '{\"location\":\"S\\u00e3o Jos\\u00e9 dos Campos\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"14\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Os participantes devem ir de cal\\u00e7a comprida e sapato fechado. \\nLevar dinheiro para almo\\u00e7o.\\n\"}}', 13, ''),
(98, 'viagem', '2017-05-24 05:30:46', '2017-05-24 13:30:56', 'Caterpillar', 'Visita técnica à planta da Caterpillar em Piracicaba, maior fábrica Caterpillar do mundo. A empresa é uma multinacional que fabrica máquinas, motores e veículos pesados, voltados principalmente para a construção civil e mineração. O cronograma da visita conta com uma recepção/coffee break, apresentação institucional e de planejamento de carreira além de, claro, um tour pela fábrica.', '{\"location\":\"Piracicaba\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\" \\u00c9 necess\\u00e1rio uso de cal\\u00e7a comprida.\\n\"}}', 13, ''),
(99, 'viagem', '2017-05-24 06:10:34', '2017-05-24 13:30:47', 'Sincrotron', 'O Laboratório Nacional de Luz Síncrotron (LNLS) integra o Centro Nacional de Pesquisa em Energia e Materiais (CNPEM), uma organização social qualificada pelo Ministério da Ciência, Tecnologia, Inovações e Comunicações (MCTIC). Localizado em Campinas (São Paulo), o LNLS é responsável pela operação da única fonte de luz síncrotron da América Latina, aberta ao uso das comunidades acadêmica e industrial. Neste tour, os visitantes conhecerão um pouco do funcionamento deste acelerador e seus principais usos, além de saber da história do Laboratório e da formação do CNPEM. O LNLS está neste momento construindo o Sirius, uma fonte de luz síncrotron de quarta geração, planejada para ser uma das mais avançadas do mundo. Sirius abrirá novas perspectivas de pesquisa em áreas como ciência dos materiais, nanotecnologia, biotecnologia, física, ciências ambientais e muitas outras. Uma vista panorâmica da obra encerra a visita.', '{\"location\":\"Campinas\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Vestir cal\\u00e7a comprida e sapato fechado e confort\\u00e1vel.\"}}', 13, ''),
(100, 'viagem', '2017-05-24 08:00:39', '2017-05-24 12:30:49', 'TAM', 'Visita técnica ao centro de manutenção de aeronaves da TAM em São Carlos - TAM MRO. A TAM MRO é uma unidade de negócios da TAM voltada para oferecer serviços de manutenção tanto de aeronaves como de seus componentes para companhias aéreas e operadores de aeronaves. Lá serão apresentados aspectos e explicações acerca dos serviços de manutenção em aeronaves, reparos de componentes e suporte de engenharia de variados modelos aviões. A planta é estruturada para atender Airbus 320 Series e 330, Fokker 100, ATR-42 e Boeing 767, considerando a manutenção pesada (para aviões de médio e grande porte).', '{\"location\":\"S\\u00e3o Carlos\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\" Fotos n\\u00e3o est\\u00e3o autorizadas. \\nN\\u00e3o \\u00e9 permitido c\\u00f3pia de documento interno.\\n\\n N\\u00e3o \\u00e9 permitido uso de bolsas e equipamentos eletr\\u00f4nicos (celulares, tablets, computadores, dentre outros). \\nOs visitantes dever\\u00e3o vestir-se com cal\\u00e7a e sapato fechado. N\\u00e3o \\u00e9 permitido uso de camiseta regata.\\n Os visitantes dever\\u00e3o portar documento de identifica\\u00e7\\u00e3o.\"}}', 13, ''),
(101, 'minicurso', '2017-05-25 08:00:42', '2017-05-25 18:00:57', 'ROS', 'Treinamento do software Robot Operating System (ROS), uma coleção de frameworks para desenvolvimento de software para aplicações robóticas. ', '{\"location\":\"Sala de Micros - 1\\u00ba andar do pr\\u00e9dio da Mecatr\\u00f4nica - Campus 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"8h\",\"alert\":\"Requisito: Conhecimentos B\\u00e1sicos em C++ e Linux\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(102, 'minicurso', '2017-05-25 08:00:28', '2017-05-25 18:00:40', 'ADAMS', 'Introdução e apresentação de ferramentas do software de simulação e modelagem de sistemas dinâmicos.', '{\"location\":\"Laborat\\u00f3rio de ensino informatizado \\u2013 Departamento de Estruturas \\u2013 Campus 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(103, 'minicurso', '2017-04-27 14:00:30', '2017-04-27 18:30:59', 'Workshop Zenith', 'Será apresentado todo o processo envolvido no desenvolvimento de uma sonda estratosférica, por meio de exemplos de lançamentos passados, detalhamento dos sistemas envolvidos em uma sonda e uma parte prática com montagem de um protótipo do tipo Cansat ', '{\"location\":\"Bloco D - Sala 6\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"4h\",\"alert\":\"Pede-se conhecimento b\\u00e1sico de Arduino por parte do participante.\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(104, 'minicurso', '2017-05-25 08:00:46', '2017-05-25 17:00:05', 'Arduino', 'O minicurso tem por finalidade introduzir os participantes ao desenvolvimento de projetos eletrônicos simples com a plataforma Arduino. Por este motivo, serão abordados os seguintes tópicos: Introdução à plataforma de desenvolvimento; conceitos básicos de eletrônica, portas digitais, porta analógicas e comunicação digital. Deste modo, ao término do curso, os participantes poderão continuar o aprendizado e iniciar seus próprios projetos.', '{\"location\":\"Bloco da Mecatr\\u00f4nica - Sala 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"15\",\"m\":{\"ch\":\"8h\",\"alert\":\"Requisito: conhecimentos b\\u00e1sicos de programa\\u00e7\\u00e3o\\nLevar Computador com a IDE do Arduino instalada! Download: https:\\/\\/www.arduino.cc\\/en\\/main\\/software (IDE Arduino 1.8.2)\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(105, 'minicurso', '2017-05-25 08:00:45', '2017-05-25 17:00:51', 'Python', 'Venha aprender programação utilizando a linguagem Python nesse curso organizado pelo grupy-sanca. Esse curso é para pessoas que não saibam programar, ou sabem pouco de programação, mas têm vontade de aprender. Serão ensinados conceitos básicos como: variáveis, tipos básicos (strings, números e listas), controle de fluxo (se, senão e enquanto), laços de repetição e funções.', '{\"location\":\"Bloco da Mecatr\\u00f4nica Sala 2 - Campus 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"8h\",\"alert\":\"\\u00c9 necess\\u00e1rio levar seu pr\\u00f3prio computador com Python 3.6.1 instalado. Link para download: https:\\/\\/www.python.org\\/downloads\\/\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(106, 'minicurso', '2017-05-25 08:00:57', '2017-05-25 17:00:11', 'Microcontroladores', 'PIC são microcontroladores da arquitetura Harvard modificada fabricados pela Microchip Technology, que processam dados de 8 bits, de 16 bits e, mais recentemente, de 32 bits. Neste minicurso serão utilizados os PICs da família 18F e, em C, conceitos de programação e aplicação do código serão passados, além da realização de experimentos práticos', '{\"location\":\"LEI Maior - Departamento de Engenharia El\\u00e9trica - Campus 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"21\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(107, 'minicurso', '2017-05-25 08:10:01', '2017-05-25 17:00:17', 'Cabeça de investidor', 'Investimentos. Isso te lembra bolsa de valores? Gráficos? Pessoas gritando em frente a uma tela?\nNão se engane, investir é mais que isso e você pode começar agora!\nO Cabeça de Investidor pode te ajudar a dar os primeiros passos, de forma prática e objetiva. Entenda porque o Tesouro direto é a sua alternativa para a poupança e como começar a investir sem grandes estresses. ', '{\"location\":\"Bloco da Mecatr\\u00f4nica - Sala 3\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"31\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(108, 'minicurso', '2017-05-25 14:00:25', '2017-04-26 18:00:33', 'FPGA', 'O minicurso pretende introduzir conceitos básicos envolvidos no projeto de sistemas digitais em dispositivos reconfiguráveis (FPGA) com o uso de linguagem de descrição de hardware. Serão vistos conceitos básicos de Lógica Digital, princípio de funcionamento dos Dispositivos Reconfiguráveis e ferramentas para desenvolvimento de projetos em FPGA.', '{\"location\":\"LEI Menor - Departamento de Engenharia El\\u00e9trica - Campus 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"16\",\"m\":{\"ch\":\"4h\",\"alert\":\"Requisito: Conhecimento de sistemas digitais (eletr\\u00f4nica digital) e linguagem de programa\\u00e7\\u00e3o\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(109, 'minicurso', '2017-05-25 08:00:50', '2017-05-25 17:00:59', 'KUKA', 'O participante conhecerá através deste minicurso as atitudes de segurança necessárias para manipulação do robô, além da programação básica do mesmo: programação &amp;amp;amp;quot;ponto-a-ponto&amp;amp;amp;quot;. O próprio participante poderá interagir com o manipulador e fundamentar seus conhecimentos, conhecendo assim a potencial dos robôs manipuladores. Uma breve fundamentação teórica sobre manipuladores será realizada no início e será apresentado também, ao final, noções sobre controle de força.', '{\"location\":\"Bloco da Mecatr\\u00f4nica - Laborat\\u00f3rio no primeiro andar\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"6\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(110, 'minicurso', '2017-05-25 08:00:07', '2017-05-25 18:00:22', 'Unity', ' O curso tem o objetivo de capacitar as pessoas a utilizarem a Unity 3D para planejarem e desenvolverem seus jogos favoritos. Durante o curso será abordado a interface, cenários, texturas, shaders, scripts, audio, etc. No final do curso todos os participantes terão um mini-jogo para brincar.', '{\"location\":\"Sala de treinamento 2 da Biblioteca do ICMC - Campus 1\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"20\",\"m\":{\"ch\":\"8h\",\"alert\":\"\\u00c9 necess\\u00e1rio levar o pr\\u00f3prio computador.\\n\\nATEN\\u00c7\\u00c3O: Preparar antes do minicurso:\\nFazer download da Unity Personal (https:\\/\\/store.unity.com\\/pt\\/download?ref=personal)\\nMarcar na instala\\u00e7\\u00e3o da Unity pelo menos:\\n\\n    Unity 5.6.1f1\\n    Documentation\\n    Standard Assets\\n\\nAtivar a conta da Unity\\n\\nObs: O Visual Studio \\u00e9 instalado junto com a Unity. Se n\\u00e3o estiver instalado, fa\\u00e7a-o manualmente.\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(111, 'mesa', '2017-05-26 09:30:47', '2017-05-26 11:30:28', 'Início de carreira', '', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
