(113, 'palestra', '2017-05-26 15:45:30', '2017-05-26 17:00:50', 'Experiências em gestão e visão de negócio ', '', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(114, 'palestra', '2017-05-25 19:00:55', '2017-05-25 20:15:06', 'Brain-machine Interfaces based on Neurorehabilitation and Sensory Substitution for Patients with Complete Paraplegia', 'A report from the world health organisation (WHO) reveals that roughly\n200&#039;000 new cases of spinal cord injury (SCI) occur world wide every\nyear.  SCI causes a wide array of devastating motor, sensory, and\nautonomic deficits. There is currently no cure for SCI.\nThe Walk Again Project (WAP) aims in developing new techniques to\nrestore sensory-motor functions for patient with paraplegia due to\nSCI.\nIn this talk I will present two techniques developed in our\nlaboratory: brain-machine interface (direct brain control of a virtual\navatar or a robotic leg) and Sensory substitution. I will present, how\nafter using a combination of these techniques, we observed\nunprecedented improvements in 8 SCI patients, in term of sensory and\nmotor functions in their lower limbs, as well as, and may be more\nimportantly, for control of their bladder, bowel and sexual functions.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 13, ''),
(115, 'minicurso', '2018-05-10 08:00:02', '2018-05-10 18:00:28', 'Unity', 'Aprenda a desenvolver jogos através da plataforma Unity\n\nAprender a desarrollar juegos de la plataforma Unity', '{\"location\":\"Biblioteca ICMC\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"10\",\"m\":{\"ch\":\"8h\",\"alert\":\"Os participantes devem estar com os respectivos computadores e com o software Unity instalado.\\nLink para download: https:\\/\\/store.unity.com\\/pt\\/download?ref=personal\\nNo in\\u00edcio do curso o ministrante auxiliar\\u00e1 na ativa\\u00e7\\u00e3o do software.\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(116, 'minicurso', '2018-05-10 08:00:36', '2018-05-10 12:00:51', 'LaTeX', 'Latex é uma linguagem definida para a diagramação de textos, utilizada amplamente na produção de artigos científicos, textos matemáticos e outros graças a sua alta qualidade tipográfica.\n\n\nLatex  es un lenguaje hecho para la diagramación de textos, muy utilizado en la producción de artículos científicos, textos matemáticos y otras cosas debido a su buena calidad tipográfica.', '{\"location\":\"Sala C8\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"15\",\"m\":{\"ch\":\"4h\",\"alert\":\"Os Participantes devem levar os pr\\u00f3prios notebooks.\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(117, 'minicurso', '2018-05-10 08:00:46', '2018-04-03 18:00:06', 'KUKA', 'O participante conhecerá através deste minicurso as atitudes de segurança necessárias para manipulação do robô, além da programação básica do mesmo: programação ponto-a-ponto. O próprio participante poderá interagir com o manipulador e fundamentar seus conhecimentos, conhecendo assim a potencial dos robôs manipuladores. Uma breve fundamentação teórica sobre manipuladores será realizada no início e será apresentado também, ao final, noções sobre controle de força.\n\nEl participante conocerá, a través del mini-curso, las actitudes de seguridad necesarias para la manipulación de un robot y su programación básica: programación punto-a-punto. El participante podrá interaccionar con el manipulador y, así conocer el potencial de los robots manipuladores.', '{\"location\":\"Pr\\u00e9dio da mecatr\\u00f4nica, segundo andar\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"9\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(118, 'minicurso', '2018-05-10 08:00:59', '2018-05-10 18:00:12', 'Arduino', 'O minicurso tem por finalidade introduzir os participantes ao desenvolvimento de projetos eletrônicos simples com a plataforma Arduino. Por este motivo, serão abordados os seguintes tópicos: Introdução à plataforma de desenvolvimento; conceitos básicos de eletrônica, portas digitais, porta analógicas e comunicação digital. Deste modo, ao término do curso, os participantes poderão continuar o aprendizado e iniciar seus próprios projetos.\n\n\nEl mini-curso tiene por finalidad introducir los participantes al desarrollo de proyectos eletrónicos sencillos con la plataforma Arduino. Entonces, serán abordados los siguientes temas: Introdución a la plataforma de desarrollo, conceptos elementares de electrónica, puertas digitales, puertas analógicas y comunicación digital. Así, al final de curso, los participantes podrán seguir con el aprendizaje y empezar sus proprios proyectos.', '{\"location\":\"Sala Mecatr\\u00f4nica 02\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"14\",\"m\":{\"ch\":\"8h\",\"alert\":\"Levar o computador pessoal com a IDE do Arduino instalada.\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(119, 'minicurso', '2018-05-10 08:00:46', '2018-05-03 18:00:55', 'Microcontroladores (PIC)', 'PIC são microcontroladores da arquitetura Harvard modificada fabricados pela Microchip Technology, que processam dados de 8 bits, de 16 bits e, mais recentemente, de 32 bits. Neste minicurso serão utilizados os PICs da família 18F e, em C, conceitos de programação e aplicação do código serão passados, além da realização de experimentos práticos.\n\n\nPIC son microcontroladores, con una arquitectura de Harvard modificada, fabricados por la Microchip Technology y que tienen la capacidad de procesar datos de 8, 16 y, actualmente, 32 bits. En este mini-curso serán utilizados los PICs de la familia 18F, serán pasados los conceptos de programación y aplicación del código en lenguaje C y serán realizados experimentos prácticos.', '{\"location\":\"Sala Lei Maior do pr\\u00e9dio da el\\u00e9trica\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"15\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(120, 'minicurso', '2018-05-10 08:00:10', '2018-05-10 18:00:13', 'ADAMS', 'O MSC.Adams é um software de modelagem e análise de sistemas dinâmicos, baseado na metodologia de sistemas multicorpos. Esta ferramenta auxilia no estudo da cinemática de mecanismos, na análise de vibrações de sistemas dinâmicos com elementos elásticos e dissipativos não lineares e na estimativa de carregamentos atuantes em sistemas mecânicos, permitindo a validação virtual de um sistema já nas fases iniciais de projeto e, portanto, contribuindo para a redução dos custos de engenharia no desenvolvimento de produtos. Utilizando a tecnologia de modelagem dinâmica de multicorpos, o MSC.Adams executa análises dinâmicas não-lineares no domínio do tempo. Os carregamentos calculados através dessa ferramenta podem ser exportados de forma adequada para serem utilizados como condição de contorno em análises de durabilidade utilizando as principais ferramentas de FEA disponíveis do mercado. Se você tem interesse em aprender a realizar simulações dinâmicas de sistemas mecânicos, este minicurso lhe dará uma base de habilidades necessárias para começar a utilizar os recursos de prototipagem virtual, testes e pós-processamento da ferramenta MSC.Adams.\n\n\nEl MSC.Adams es un software para modelar y analisar sistemas dinámicos teniendo por base la metodología de sistemas multicuerpos. Esta herramienta ayuda en la análisis de la cinemática de los mecanismos, de las vibraciones de sistemas dinámicos con elementos elásticos y en la estimación de cargas actuantes en sistemas mecánicos. Así, se consigue la validación virtual de un sistema en las fases iniciales del proyecto y, entonces, se contribuye para la redución de los custos de ingeniería en el desarrollo de productos. Utilizando la tenología para modelar, el MSC.Adams ejecuta análisis dinámicas no-lineares en el dominio del tiempo. Las cargas calculadas a través de la herramienta pueden ser exportadas adecuadamente para seren utilizadas cómo condición de contorno en análisis de durabilidad, utilizando las principales herramientas de FEA disponibles en el mercado. Si tienes interés en aprender a realizar simulaciones dinámicas de sistemas mecánicos, este mini-curso le donará la base de aptitud para empezar a utilizar los recursos de prototipos virtuales, testes y pos-procesamiento de herramientas MSC.Adams.', '{\"location\":\"Biblioteca EESC\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"10\",\"m\":{\"ch\":\"8h\",\"alert\":\"\\u00c9 recomendavel que o participante esteja cursando a partir do 5\\u00ba per\\u00edodo\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(121, 'minicurso', '2018-05-10 08:00:01', '2018-04-03 18:00:09', 'ROS', 'Treinamento do software Robot Operating System (ROS), uma coleção de frameworks para desenvolvimento de software para aplicações robóticas.\n\nEntrenamiento del software Robot Operating System (ROS): una colección de framworks para el desarrollo de softwares para aplicaciónes robóticas.', '{\"location\":\"Pr\\u00e9dio da mecatr\\u00f4nica, segundo andar\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"21\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(122, 'minicurso', '2018-05-10 08:00:58', '2018-05-10 18:00:10', 'Python', 'Venha aprender a programar na linguagem Python com o grupy-sanca em um curso totalmente gratuito. Para quem é este curso? Pessoas que não saibam programar, mas têm vontade de aprender e programadores iniciantes que não saibam Python. Para quem não é este curso? Programadores experientes, pessoas que já desenvolvem na linguagem. Conteúdo: - Algoritmos - Operadores aritméticos - Variáveis - Tipos básicos (strings, inteiros, pontos flutuantes e listas) - Controle de fluxo - Laços - Funções Contatos: PáginaFacebook: https://www.facebook.com/grupysanca\n\n\nVenga aprender como programar en linguaje Python con el grupy-sanca en un mini-curso completamente gratis. Para quién es este curso? Para personas que no sepan programar, mas tengan ganas de aprender y para programadores que están empezando y no saben Python. Para quién no es este curso? Para programadores experientes y personas que ya tengan el lenguaje desarrollado. Hay la necesidad de llevarse algo? Sí, dos cosas: notebook con Python 3 instalado y, caso posea, su botella personal para la merienda. Contenido: - Algoritmos - Operadores aritméticos - Variables - Tipos básicos (strings, enteros, puntos flotantes y listas) - Controle de flujo - Lazos - Funcciones, Contactos: PáginaFacebook: https://www.facebook.com/grupysanca Grupo Facebook: https://www.facebook.com/groups/grupysanca/ Grupo Telegram: https://t.me/grupysanca', '{\"location\":\"Sala Mecatr\\u00f4nica 03\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"10\",\"m\":{\"ch\":\"8h\",\"alert\":\"Participantes devem levar notebook com Python 3 instalado.\\nGuia para instala\\u00e7\\u00e3o: http:\\/\\/curso.grupysanca.com.br\\/pt\\/latest\\/instalacao.html\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(124, 'minicurso', '2018-05-10 14:00:29', '2018-05-10 18:00:50', 'PNL aplicado à comunicação', 'A Programação Neurolinguística, criada em 1970, é a arte excelência humana, ou seja, das qualidades pessoais. É uma ferramenta, uma tecnologia, que possibilita as pessoas a mudarem seus pensamentos, sentimentos e ações, conquistar objetivos, autoconhecer, ter maestria de comunicação, ter mais qualidade de vida, descobrir o que funciona numa pessoa de sucesso. É uma abordagem de comunicação, desenvolvimento pessoal e psicoterapia.\n\n\nLa Programación Neurolingüistica, creada en 1970, es el arte de la excelencia humana, o sea, de las calidades personales. Es una herramienta que posibilita que personas cambien sus pensamientos, sentimientos y acciones, logren objetivos, se auto-conoscan, se comuniquen muy bién, tengan más calidad de vida y descubran el secreto de una persona de éxito. Es un abordaje de comunicación, desarrollo personal y psicoterapia.  ', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"26\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(125, 'minicurso', '2018-05-10 14:00:18', '2018-05-10 18:00:26', 'Linux Embarcado', 'O treinamento será de introdução básica a Linux Profissional para Sistemas Embarcados. Será abordado com teoria e prática conceitos como compilação cruzada, toolchain e abstração de acesso a periféricos por SYSFS.\n\n\nEl entrenamiento tendrá una introducción básica al Linux Profesional para Sistemas Embarcados. Conceptos como compilación cruzada, toolchain y abstracción del acceso a periféricos por SYSFS.', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"8\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(126, 'minicurso', '2018-05-10 14:00:21', '2018-05-10 18:00:26', 'FPGA', 'O minicurso pretende introduzir conceitos básicos envolvidos no projeto de sistemas digitais em dispositivos reconfiguráveis (FPGA) com o uso de linguagem de descrição de hardware. Serão vistos conceitos básicos de Lógica Digital, princípio de funcionamento dos Dispositivos Reconfiguráveis e ferramentas para desenvolvimento de projetos em FPGA.\n\n\nEl mini-curso pretiende introducir conceptos básicos involucrados en el proyecto de sistemas digitales en dispositvos reconfigurables (FPGA) con el uso del lenguaje  de descripción de hardware. Serán enseñados conceptos básicos de Lógica Digital, base de funccionamiento de Dispositivos Reconfigurables y herramientas para el desarrollo de proyectos en FPGA.', '{\"location\":\"Sala Lei Menor do pr\\u00e9dio da el\\u00e9trica\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"9\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(127, 'viagem', '2018-05-09 07:00:03', '2018-04-11 12:00:14', 'Hyundai', 'A instalação é responsável pela montagem da linha HB20, totalmente desenvolvida e destinada aos consumidores brasileiros, produzindo cerca de 150 mil carros por ano. Essa empresa desenvolve atividades de estamparia, carroceria, pintura e montagem final dos veículos.\n\n\nEl edificio es responsable por el montaje de la línea de conches HB20,  totalmente desarrollada y destinada a los consumidores brasileños, producciendo cerca de 150 mil coches por año. Esa empresa desarrolla actividades de estamparia, carrocería, pintura y montaje final del vehículo.', '{\"location\":\"Piracicaba - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"31\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Contatar com antecedencia a organiza\\u00e7\\u00e3o em caso de deficiencia ou dificuldade de caminhar.\\nN\\u00e3o \\u00e9 permitido: Saia, bermuda, cal\\u00e7a rasgada, camiseta de time, regata e cal\\u00e7ado aberto\\/salto.\\nN\\u00e3o \\u00e9 permitido tirar foto.\\nLevar documento de identifica\\u00e7\\u00e3o.\"}}', 14, ''),
(128, 'viagem', '2018-04-11 07:00:28', '2018-04-11 20:00:33', 'INPE', 'O Instituto Nacional de Pesquisas Espaciais (INPE) localizado em São José dos Campos - SP, é responsável por toda a pesquisa espacial desenvolvida no Brasil. Atualmente, o desenvolvimento de satélites para monitoramento da Amazônia através da parceria com a China, por exemplo,  tem seu projeto e concepção concatenados no INPE. O Laboratorio Integrado de Testes (LIT) é responsável por testar exaustivamente, nas condições mais adversas, todos os projetos concebidos pelo INPE. O participante da XIV Sematron terá a oportunidade de visitar as instalações do LIT e ter uma palestra do Diretor do Laboratório a respeito da atual condição da pesquisa espacial brasileira.\n\n\nEl Instituto Nacional de Pesquisas Espaciales (INPE), ubicado  en São José dos Campos - SP, es responsable por toda la pesquisa espacial desarrollada en Brasil. Actualmente, el desarrollo de satélites para monitorear la Amazónia tiene su proyecto y concepción ubicado en el INPE y un convenio con China. El Laboratorio Integrado de Testes (LIT) es responsable por testar, en condiciones adversas, todos los proyectos desarrollados  en el INPE. Los participantes de la XIV Sematron tienen la oportunidad de visitar las instalaciones del LIT y de oír una conferencia del Diretor del Laboratorio  sobre la actual situación de la pesquisa espacial brasileña.', '{\"location\":\"S\\u00e3o Jos\\u00e9 dos Campos - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"31\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Sa\\u00edda prevista (partindo de S\\u00e3o Carlos): 7h\\nChegada prevista: 20h\\n\\nObs.:\\n1) Usar cal\\u00e7a e sapato fechado;\\n2) Levar documento original com foto (para participantes de outra nacionalidade, o passaporte);\\n3) Levar dinheiro para comer no almo\\u00e7o e na estrada (opcional);\\n4) Recomenda-se levar garrafa de \\u00e1gua.\"}}', 14, ''),
(129, 'viagem', '2018-04-11 12:30:34', '2018-04-11 15:00:45', 'TAM', 'Dona da maior frota de aeronaves comerciais do Brasil, com mais de 160 aparelhos, a Tam possui um centro de manutenção com dimensões colossais. São quatro hangares, sendo um deles capaz de receber ao mesmo tempo dois jatos widebodies (de grande porte), como os Airbus A330 e Boeing 767 da empresa.\nOs particiantes da XIV SEMATRON terão a oportunidade de checar de perto o funcionamento da maior oficina de aeronaves do Brasil.\n\n\nDueña de la flota más grande de aeronaves comerciales en Brasil, con más de 160 máquinas, la TAM tiene un centro de manutención con dimensiones colosales. Són cuatro hangares y uno de ellos es capaz de recibir dos aeronaves widebodies (de porte grande) a la vez, como el Airbus A330 y el Boeing 767 de la empresa. Los participantes de la XIV SEMATRON tendrán la oportunidad de analisar internamente el funcionamiento del taller más grande de aeronaves brasileño.', '{\"location\":\"S\\u00e3o Carlos - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"31\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Em caso de visitantes com necessidades especiais, comunique a organiza\\u00e7\\u00e3o.\\nAs fotos durante a visita n\\u00e3o s\\u00e3o autorizadas.\\nN\\u00e3o \\u00e9 ermitida a c\\u00f3pia de documentos internos.\\nUsar cal\\u00e7a e sapato fechado. N\\u00e3o \\u00e9 permitido o uso de camiseta regata.\\nOs visitantes dever\\u00e3o portar documento de identifica\\u00e7\\u00e3o.\"}}', 14, ''),
(130, 'viagem', '2018-04-03 12:00:18', '2018-04-11 18:30:28', 'Bosch', '', '{\"location\":\"Hortol\\u00e2ndia - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"25\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(131, 'viagem', '2018-04-11 06:00:55', '2018-04-11 14:00:38', 'Tigre', 'Visita à planta responsável pela produção de rotomoldagem, tubos e conexões. É a maior planta fabril de transformação de PVC do mundo, além de corresponder a 14% da arrecadação de impostos do município.\n\n\nVisita al edificio responsable por la producción de rotomoldaje, tubos y conexiones. Es el edificio fabril más grande de transformación de PVC en el mundo y sú recaudación corresponde a 14% de todos los impuestos de la ciudad.', '{\"location\":\"Rio Claro - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"20\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(132, 'viagem', '2018-04-11 08:00:56', '2018-04-11 21:30:01', 'IBM', 'Inaugurado em 1977, o prédio compreende as mais importantes organizações de negócios e serviços e é o principal centro gerador de negócios da IBM na América Latina. O participante da XIV SEMATRON contará com um tour pelo prédio que é referencia arquitetonica até hoje no mundo, tendo acesso a palestra e coofee breake.\n\n\nInaugurado en 1977, el edificio incuye las más importantes organizaciones de negocios y servicios, siendo el principal centro generador de negocios de la IBM en América Latina. El participante de la SEMATRON podrá hacer una visita por el edificio que es referencia arquitectónica actual en el mundo y tendrá acceso a conferencias e meriendas.', '{\"location\":\"S\\u00e3o Paulo - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(133, 'viagem', '2018-04-11 09:00:09', '2018-04-11 11:30:13', 'XMobots', 'A XMobots é uma empresa brasileira especializada no desenvolvimento, fabricação, treinamento, manutenção e operação de sistemas não tripulados, incluindo UAVs (também conhecidos no Brasil como VANTs - Veículos Aéreos Não Tripulados), AUVs, ROVs, USVs, UGVs e Estações de Controle Terrestre. A origem de seu nome veio da união do prefixo X referindo-se aos meios onde os veículos da empresa são capazes de operar, ou seja, ar, terra ou água, com o termo Mobots, procedente da contração das palavras do inglês mobile robots (robôs móveis).', '{\"location\":\"S\\u00e3o Carlos - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"8\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(134, 'minicurso', '2018-05-10 08:00:55', '2018-05-10 21:00:08', 'Visita Técnica na Toyota', 'Operando desde 1962, a planta da Toyota de São Bernardo do Campo foi a primeira da empresa fora do Japão. Ha alguns anos passa por um completo processo de revitalização e aprimoramento. Desde 2016 inaugurou lá o primeiro Centro de Pesquisa Aplicada da América Latina e recentemente abriu o centro de visitas a comunidade. Os participantes da XIV Sematron terão a oportunidade de checar de perto essa nova iniciativa da gigante do mercado automobilistico.\n\n\nFunccionando desde 1962, el edificio de la Toyota de São Bernardo del Campo fue el primero que la empresa hizo fuera de Japón. Hace unos años, el edificio pasó por un proceso de mejora arquitectónica. Desde 2016, el primero Centro de Pesquisa Aplicada de América Latina ha sido inaugurado y, recientemente, el centro de visitas a la comunidad ha sido abierto. Los participantes de la XIV SEMATRON tendrán la oportunidad de visitar la nueva iniciativa de la gigante del mercado automobilistico.', '{\"location\":\"S\\u00e3o Bernardo do Campo - SP\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"29\",\"m\":{\"ch\":\"\",\"alert\":\"Sa\\u00edda de S\\u00e3o Carlos: 8h\\nChegada prevista: 21h\\nSER\\u00c1 NO MESMO DIA DOS MINICURSOS\\nESTA OP\\u00c7\\u00c3O N\\u00c3O GARANTE O CERTIFICADO DE MINICURSOS\\n\\u00c9 POSS\\u00cdVEL ESCOLHER OUTRA VISITA T\\u00c9CNICA NO ITEM VISITA T\\u00c9CNICA\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
(135, 'minicurso', '2018-05-10 08:00:04', '2018-05-10 12:00:23', 'Microchip Technology', 'Serão apresentados conceitos sobre criptografia, wi-fi, bluetooth e microcontroladores PIC e AVR, considerando os principais aspectos que precisam ser considerados durantes a implementação dessas tecnologias nos projetos. Também serão apresentadas as funcionalidades e benefícios dos itens da Microchip Technology para os conceitos foco da aula.', '{\"location\":\"Sala Mecatr\\u00f4nica 01\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"15\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 14, ''),
