(263, 'minicurso', '2024-05-28 19:00:00', '2024-05-28 22:00:00', 'Deep Learning', 'Este minicurso, realizado em parceria com a NVIDIA, aborda as representações virtuais de processos físicos, conhecidas como Deep Learning. Destinado a um público familiarizado com o tema, o curso explora os conceitos avançados por trás dessa tecnologia emergente.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"15\",\"m\":{\"ch\":\"6h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 28\\/05 e 29\\/05.\",\"cont\":\"\"},\"v\":{\"ch\":\"6h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 28\\/05 e 29\\/05.\",\"cont\":\"\"}}', 20, ''),
(264, 'minicurso', '2024-05-28 19:00:00', '2024-05-28 22:00:00', 'RPA - Automação Robótica de Processos (Visagio)', 'Neste minicurso ministrado pela Visagio, os participantes terão a oportunidade de aprender sobre Automação Robótica de Processos (RPA). O curso é acessível para iniciantes e visa introduzir os fundamentos e aplicações práticas dessa tecnologia.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"34\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"3h\",\"alert\":\"\",\"cont\":\"\"}}', 20, ''),
(265, 'minicurso', '2024-05-30 19:00:00', '2024-05-30 22:00:00', 'Montagem e Desmontagem de um Trator (Husqvarna)', 'Neste minicurso prático, os participantes terão a oportunidade de desmontar e conhecer as partes de um trator da Husqvarna. Realizado em um dia, o curso oferece uma experiência hands-on para os entusiastas da engenharia.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"3h\",\"alert\":\"\",\"cont\":\"\"}}', 20, ''),
(266, 'minicurso', '2024-05-28 19:00:00', '2024-05-28 22:00:00', 'Criptografia (Profa. Kalinka Castelo Branco)', 'Este minicurso de três dias aborda os fundamentos da criptografia, incluindo introdução, mecanismos de defesa e mecanismos de ataque. Os participantes terão a oportunidade de entender os princípios subjacentes à segurança da informação.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"40\",\"m\":{\"ch\":\"10h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 28\\/05, 29\\/05 e 30\\/05.\",\"cont\":\"\"},\"v\":{\"ch\":\"10h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 28\\/05, 29\\/05 e 30\\/05.\",\"cont\":\"\"}}', 20, ''),
(267, 'minicurso', '2024-05-29 19:00:00', '2024-05-30 22:00:00', 'Inteligência Artificial (MSc. João Manoel Pinheiro)', 'Este minicurso de dois dias aborda os princípios fundamentais do machine learning, uma subárea da inteligência artificial. Os participantes terão a chance de explorar desde os conceitos básicos até aplicações avançadas.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"22\",\"m\":{\"ch\":\"6h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 29\\/05 e 30\\/05.\",\"cont\":\"\"},\"v\":{\"ch\":\"6h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 29\\/05 e 30\\/05.\",\"cont\":\"\"}}', 20, ''),
(268, 'minicurso', '2024-05-30 19:00:00', '2024-05-30 22:00:00', 'Desmistificando OpenAI (Alura)', 'Desmistificando OpenAI: Análise de Imagens das área da saúde com Agentes Inteligentes e Ferramentas de Interpretação de Código\n\nVocê está no início da sua jornada na tecnologia e quer explorar o poder da inteligência artificial? Participe do nosso workshop de OpenAI, e IA Generativa! Vamos mostrar como utilizar os LLMs da OpenAI, incluindo o Vision para analisar exames de imagem  e como integrar agentes inteligentes e interpretadores de código para criar aplicações práticas que podem impactar o setor de saúde. Não perca essa oportunidade de aprender e se inspirar com ferramentas que estão moldando o futuro da tecnologia!', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"3h\",\"alert\":\"\",\"cont\":\"\"}}', 20, ''),
(269, 'minicurso', '2024-05-28 19:00:00', '2024-05-29 22:00:00', 'PCB (Prof. Daniel Varela)', 'Este minicurso de dois dias explora o processo de projeto e teste de placas de circuito impresso (PCBs). Os participantes aprenderão desde a introdução básica até a verificação de funcionamento das placas.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"6h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 28\\/05 e 30\\/05.\",\"cont\":\"\"},\"v\":{\"ch\":\"6h\",\"alert\":\"Minicurso do tipo EXTENDIDO - acontecer\\u00e1 nos dias 28\\/05 e 29\\/05.\",\"cont\":\"\"}}', 20, ''),
(270, 'minicurso', '2024-05-30 19:00:00', '2024-05-30 22:00:00', 'O Engenheiro no Mercado Financeiro (EESC Finance)', 'Este minicurso oferece estratégias e insights para a introdução de engenheiros no mercado financeiro. Aborda as oportunidades e desafios dessa transição de carreira.', '{\"location\":\"A definir\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"3h\",\"alert\":\"\",\"cont\":\"\"}}', 20, ''),
(272, 'minicurso', '2024-05-28 19:00:00', '2024-05-28 22:00:00', 'Impressão 3D (F3D)', 'Ministrado pela F3D, este minicurso tem como objetivo familiarizar os participantes com os princípios e técnicas de impressão 3D. Os participantes terão a oportunidade de explorar os fundamentos e aplicações práticas dessa tecnologia inovadora.', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"3h\",\"alert\":\"\",\"cont\":\"\"}}', 20, ''),
(273, 'minicurso', '2026-05-28 19:00:00', '2026-05-28 22:00:00', 'Manipulação de Robô KUKA (Prof. Glauco Caurin)', 'Este minicurso, realizado em um dia, oferece uma introdução à manipulação de robôs KUKA. O curso abrange os princípios básicos de operação e programação dos robôs KUKA.', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"20\",\"m\":{\"ch\":\"6h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"3h\",\"alert\":\"\",\"cont\":\"\"}}', 22, ''),
