(292, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Máquinas Industriais', 'O minicurso abordará o manuseio das ferramentas torno, fresa e solda, por meio de aulas práticas ministradas pelos técnicos do Lamafe(Laboratório de máquinas e ferramentas da USP) e por estudantes das extras automobilísticas.\n', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"16\",\"m\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(293, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Elementos Finitos', 'O minicurso abordará os princípios do Método dos Elementos Finitos aplicado ao cálculo de estruturas. Vai ser discutido os temas de formulação unidimensional, aplicável a estruturas de barras simples, e noções sobre a construção de aproximações em problemas bi e tridimensionais. Os principais conceitos serão verificados em análises feitas em softwares comerciais e usando bibliotecas em linguagem Python.\n', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"13\",\"m\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(294, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Placas de PCB', 'Design, fabricação e solda em PCBs\n', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"16\",\"m\":{\"ch\":\"6\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"6\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(295, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Criptografia', '', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"14\",\"m\":{\"ch\":\"6\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"6\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(296, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Reinforcement Learning', 'Este workshop é destinado a estudantes que desejam mergulhar no estado da arte aprendizado por reforço (reinforcement learning) aplicado à robótica.\n', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"12\",\"m\":{\"ch\":\"6\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"6\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(297, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Biotrônica: Impressão 3D', 'Impressão 3d\n', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"13\",\"m\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(299, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Altair: Sensores Virtuais ', 'Neste minicurso, você aprenderá na prática como dados provenientes de simulações ou medições físicas podem ser utilizados para treinar modelos de sensores virtuais capazes de prever o comportamento de sistemas complexos em tempo real, com alta precisão e eficiência computacional.\n', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"15\",\"m\":{\"ch\":\"2\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"2\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
(300, 'minicurso', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'Venturus: IA Generativa', 'Fundamentos, Ferramentas e Casos Reais\nEste minicurso introdutório apresenta os conceitos essenciais da Inteligência Artificial Generativa, com foco em seu uso como assistente no desenvolvimento e aplicação de competências técnicas (hard skills) e comportamentais (soft skills). Serão abordados os principais modelos de linguagem utilizados (como os de OpenAI, Anthropic e Google), além da demonstração de ferramentas acessíveis e de casos práticos voltados ao contexto profissional. Voltado a estudantes de engenharia, o curso não exige experiência prévia com IA — apenas curiosidade e vontade de explorar como essa tecnologia pode ampliar seu potencial pessoal e profissional.\nDimitri Augusto de Jesus Lopes\n\nStaff de Arquitetura de Software no Venturus.\n\n\nEngenheiro de Computação formado pela UNICAMP, com MBA em Engenharia de Software, formação em Life Coaching e certificação em Arquitetura de Software. Com 25 anos de experiência na indústria, atuo como catalisador da excelência - tanto na criação de soluções de software quanto no desenvolvimento dos profissionais que as constroem', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"13\",\"m\":{\"ch\":\"2\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"ch\":\"2\",\"alert\":\"\",\"cont\":\"\"}}', 21, ''),
